    false,nt"url": null,nt"notes": "This annual narrative report for Big Muddy
    National Fish and Wildlife Refuge summarizes refuge activities during the fiscal
    year 1998. The report begins with an introduction to the refuge and a summary of
    the yearu2019s highlights and climatic conditions.  Information about monitoring
    and studies- including fishery surveys, amphibian monitoring and seasonal flooding
    is provided next. Habitat and wildlife management were not discussed because the
    refuge was in its early stages of development.  Coordination activities, such as
    private land activities and cooperative organizations, are outlined. The resource
    protection section provides information about law enforcement, water rights, and
    land acquisition.  Information about public education and recreation is given including
    visitor services and refuge visitation.  Finally, refuge planning and administration
    are discussed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
